import { Routes, Route, Link } from "react-router-dom";
import Hangman from './Hangman';
import { BrowserRouter } from "react-router-dom"



function App() {
  return (
    <div>
      <nav>
        <Link to="/hangman">Hangman</Link>
      </nav>
      <Routes>
        <Route exact path="/hangman" component={<Hangman />}></Route>
      </Routes>
    </div>
  );
}

export default App;
